  [],\n\t\"revision_timestamp\": \"2016-07-27T23:04:46.163811\",\n\t\"name\": \"2000-land-cover-land-use-in-the-crab-orchard-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The The U.S. Geological Survey (USGS) and
  the U.S. Fish and Wildlife Service (USFWS) are collaborating to develop a Comprehensive
  Conservation Plan (CCP) for Crab Orchard National Wildlife Refuge (CRO NWR). The
  USGS Upper Midwest Environmental Sciences Center (UMESC) has produced a high-resolution
  land cover and land use (LCU) spatial database of CRO NWR. LCU data were interpreted
  from September 15, 2000 color infrared (CIR) aerial photographs (1:15,000-scale).
  The USFWS collected the aerial photographs for the mapping project. Vegetation types
  were classified to the National Vegetation Classification System (NVCS) at the Formation
  level and, when necessary and possible, the Alliance level. Non-vegetated features,
  such as campgrounds and roads, were classified with refuge-derived classes. In addition,
  special modifiers were applied to certain map classes to provide specific information
  important to the refuge that is not provided by the NVCS. The database covers the
  entire refuge. CRO NWR is located in southern Illinois near Carbondale and Marion.\",\n\t\"license_title\":
